import unittest
from parameterized import parameterized
from stringstoanagrams import anagram

class StringsToAnagramsTest(unittest.TestCase):
  @parameterized.expand([
    ("short string length 6", "aaabbb", 3),
    ("short string length 2", "ab", 1),
    ("short string of odd length", "abc", -1),
    ("short string length 4", "mnop", 2),
    ("short string length 4 with anagram", "xyyx", 0),
    ("short string length 4 with one mismatch", "xaxbbbxx", 1),
    ("long random string length 10000", "", 191),
    ("long random string length 10000", "", 216),
    ("long random string length 10000", "", 198),
    ("long random string length 10000", "", 180),
    ("long random string length 10000", "", 166),
    ("long random string length 10000", "", 205),
    ("long random string length 10000", "", 171),
    ("long random string length 10000", "", 213),
    ("long random string length 10000", "", 138),
    ("long random string length 10000", "", 152),
  ])

  def test_anagram_distance(self, name, input, expected):
    self.assertEqual(anagram(input), expected)
